import Panel from '../components/panel'

import styled from 'styled-components'
import '../styles/theme.css'

const Widgets = ({className}) => (
    <GridStyles className={className}>
      <PanelScore />
      <PanelThroughput />
      <PanelA />
      <PanelB />
      <PanelC />
      <PanelD />
      <PanelE />
      <PanelF />
      <PanelIssues />
    </GridStyles>
  );

const GridStyles = styled('div')`
  display: grid;
  grid-template-columns: repeat(6, auto);
  grid-template-rows: 1fr 1fr 1fr 2fr;
  gap: var(--space-unit);
`;

const PanelScore = styled(Panel)`
  grid-column: 1/4;
  grid-row: 1/2;
`;

const PanelThroughput = styled(Panel)`
  grid-column: 4/7;
  grid-row: 1/2;
`;

const PanelA = styled(Panel)`
  grid-column: 1/3;
  grid-row: 2/3;
`;

const PanelB = styled(Panel)`
  grid-column: 3/5;
  grid-row: 2/3;
`;

const PanelC = styled(Panel)`
  grid-column: 5/7;
  grid-row: 2/3;
`;

const PanelD = styled(Panel)`
  grid-column: 1/3;
  grid-row: 3/4;
`;

const PanelE = styled(Panel)`
  grid-column: 3/5;
  grid-row: 3/4;
`;

const PanelF = styled(Panel)`
  grid-column: 5/7;
  grid-row: 3/4;
`;

const PanelIssues = styled(Panel)`
  grid-column: 1/7;
  grid-row: 4/5;
`;

export default Widgets;
